The enumerate parameter will generate an additional enum containing all states; this is useful when dealing with anything that requires a more "general" concept of state. Consider the file examples/light_bulb.rs : #[typestate(enumerate = "LightBulbStates")]
mod light_bulb { #[state] struct On; #[state] struct Off; // ...
} Using the enumerate attribute will add the following enum to the expansion: pub enum LightBulbStates { Off(LightBulb<Off>), On(LightBulb<On>),
}

