The state_constructors parameter will generate additional constructors for each state with fields ; this is useful when declaring states inside the automaton. Consider the following example state: #[typestate(state_constructors = "new_state")]
mod light_bulb { #[state] struct On { color: [u8; 3] } // ...
} When compiled, the following constructor is generated: impl On { pub fn new_state(color: [u8; 3]) -> Self { Self { color } }
}

