Putting it simply, states may require to mutate themselves without transitioning, or maybe we require a simple getter. To declare methods for that purpose, we can use functions that take references (mutable or not) to self. Consider the following example where we have a flag that can be up or not. We have two functions, one checks if the flag is up, the other, sets the flag up. #[state] struct Flag { up: bool
} impl Flag { fn is_up(&self) -> bool; fn set_up(&mut self);
} As these functions do not change the typestate state, they transition back to the current state.

